import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  Container,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TextField,
  Box,
  Typography,
  CircularProgress,
  TablePagination,
} from '@mui/material';

function App() {
  const [pairs, setPairs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');
  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(10);

  useEffect(() => {
    const fetchPairs = async () => {
      try {
        const response = await axios.get('http://localhost:5000/api/pairs');
        setPairs(response.data.data);
        setLoading(false);
      } catch (err) {
        setError('Error fetching pairs data');
        setLoading(false);
      }
    };

    fetchPairs();
  }, []);

  const filteredPairs = pairs.filter(pair =>
    pair.pairName.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };

  if (loading) {
    return (
      <Container sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
        <CircularProgress />
      </Container>
    );
  }

  if (error) {
    return (
      <Container>
        <Typography color="error" sx={{ mt: 4 }}>{error}</Typography>
      </Container>
    );
  }

  return (
    <Container maxWidth="xl" sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>
        Meteora Trading Pairs
      </Typography>

      <Box sx={{ mb: 2 }}>
        <TextField
          label="Search Pairs"
          variant="outlined"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          sx={{ width: 300 }}
        />
      </Box>

      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 650 }} aria-label="pairs table">
          <TableHead>
            <TableRow>
              <TableCell>Pair Name</TableCell>
              <TableCell align="right">Price</TableCell>
              <TableCell align="right">24h Volume</TableCell>
              <TableCell align="right">24h Fees</TableCell>
              <TableCell align="right">APR (%)</TableCell>
              <TableCell align="right">APY (%)</TableCell>
              <TableCell align="right">Reserve X</TableCell>
              <TableCell align="right">Reserve Y</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {filteredPairs
              .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
              .map((pair, index) => (
                <TableRow
                  key={index}
                  sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                >
                  <TableCell component="th" scope="row">
                    {pair.pairName}
                  </TableCell>
                  <TableCell align="right">
                    ${Number(pair.price).toLocaleString(undefined, { minimumFractionDigits: 6 })}
                  </TableCell>
                  <TableCell align="right">
                    ${Number(pair.volume24h).toLocaleString()}
                  </TableCell>
                  <TableCell align="right">
                    ${Number(pair.fees24h).toLocaleString()}
                  </TableCell>
                  <TableCell align="right">
                    {Number(pair.apr).toLocaleString()}%
                  </TableCell>
                  <TableCell align="right">
                    {Number(pair.apy).toLocaleString()}%
                  </TableCell>
                  <TableCell align="right">
                    {Number(pair.reserveX).toLocaleString()}
                  </TableCell>
                  <TableCell align="right">
                    {Number(pair.reserveY).toLocaleString()}
                  </TableCell>
                </TableRow>
            ))}
          </TableBody>
        </Table>
        <TablePagination
          rowsPerPageOptions={[10, 25, 50, 100]}
          component="div"
          count={filteredPairs.length}
          rowsPerPage={rowsPerPage}
          page={page}
          onPageChange={handleChangePage}
          onRowsPerPageChange={handleChangeRowsPerPage}
        />
      </TableContainer>
    </Container>
  );
}

export default App;
